  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of this study was to determine
  the amount of subsurface subsidence at Naval Weapons Station Seal Beach (NWSSB)
  areas which include Seal Beach National Wildlife Refuge (SBNWR) since the last extensive
  survey in 1994. Since no benchmarks were established on the tidal marsh, data from
  the surrounding NWSSB was used for the SBNWR. Rates of subsidence could vary between
  terrestrial and tidal environments since benchmarks were only terrestrial, but if
  subsidence was occurring in terrestrial areas surrounding the SBNWR, we assumed
  the same surface subsidence in the tidal marsh. We sought to update established
  benchmarks and examine sub-surface elevation changes from Continuously Operating
  Reference Stations (CORS) established by the National Geodetic Survey (NGS). This
  information will be critical for modeling sea level rise at SBNWR. The sustainability
  of the marsh may have important implications for conservation strategies of habitat
  and endangered species. Results from our NGS benchmark surveys showed that subsidence
  is still occurring at NWSSB at a rate of-4.13 mm/yr (SE u00b1 1.21 mm/yr) since
  the last survey in 1994. The nearby CORS elevation trends confirm local subterranean
  subsidence and were within the range of measured local subsidence on the refuge.
  However, the differing elevation trends in the CORS demonstrates the need for local
  measurements and site specific data. The mean rate of subsidence from the measured
  NGS benchmarks is in agreement with results from a broader study of elevation change
  done for the Los Angeles Basin (Fig. 10; Shen et al. 2011). Subterranean fluid extraction
  along with tectonic action is believed to be causing the regional patterns in subsidence
  and uplift (Bawden et al. 2001), and the cyclical patterns in the continuous CORS
  data are likely showing patterns of withdrawal and recharge from precipitation (Figs.
  5-9).The long-term sustainability of SBNWR tidal salt marsh ecosystem faces threats
  from regional and local subsidence, sediment availability and sea-level rise. The
  current rate of sea-level rise in southern California is 2.1 mm/yr (NRC 2012) and
  when combined with subsidence rates, SBNWR is experiencing a relative sea-level
  rise rate three times more (6.23 mm/yr) than that of similar southern California
  marshes not experiencing subsidence. Compared to the NRC (2012) sea-level rise projection
  curve, we found that the current rate of relative sea-level rise at SBNWR with subsidence
  is now similar to the rate expected in 2036 for areas of southern California without
  subsidence.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
